async function GetUsers()
{
  const t =sessionStorage.getItem("tokenKey");
  let response = await fetch(url,{
    method: "GET",
    headers: 
    {
        "Accept": "application/json",
        "Authorization": "Bearer " + t
    }
  });
  if(response.ok)
  {
    let json = await response.json();
    console.log(json);
  }
}


